def makeform(root, frame):
    entries = {}
    row = 0
    for field in fields:
        lab = tk.Label(frame,width=130,text=field+": ", anchor='w')
        lab.grid(row=row, column=0)
        ent = tk.Entry(frame)
        ent.grid(row=row, column=1)
        ent.insert(0, "0")
        entries[field] = ent
        row += 1
    f1 = tk.Frame(frame)
    b1 = tk.Button(f1, padx=1, pady=1, text="Run", command=(lambda e=entries: project_name(e)))
    b2 = tk.Button(f1, padx=1, pady=1, text='Quit', command=root.destroy)
    f1.grid(row=row, column=0, sticky="nsew")
    b1.pack(side="left")
    b2.pack(side="left")
def onFrameConfigure(canvas):
    '''Reset the scroll region to encompass the inner frame'''
    canvas.configure(scrollregion=canvas.bbox("all"))
  
if __name__ == '__main__':
    root = tk.Tk()
    root.title("wscolumn English Units Investigate V.2")
    canvas = tk.Canvas(root, width=500, borderwidth=0)
    frame = tk.Frame(canvas)
    vsb = tk.Scrollbar(root, orient="vertical", command=canvas.yview)
    canvas.configure(yscrollcommand=vsb.set)
    vsb.pack(side="right", fill="y")
    canvas.pack(side="left", fill="both", expand=True)
    canvas.create_window((4,4), window=frame, anchor="nw")
    frame.bind("<Configure>", lambda event, canvas=canvas: onFrameConfigure(canvas))
    makeform(root, frame)
    root.mainloop()


